import React from 'react'
import { BrowserRouter as Router, Switch, Route, Routes } from "react-router-dom";

import {Article, Header, Brand, Navbar } from './components';
import './App.css';

const App = () => {
  return (
    <Router>
        <div  className="App">
          <div className='gradient__bg'>
            <Navbar />
            <Header />
            <Routes>
              <Route path='/header' component={Header} />
              {/* <Brand />
              <Footer /> */}
            </Routes>
          </div>
        </div>
    </Router>
  )
}

export default App
